import "./App.css"
import Navbar from "./components/Navbar";
import NavbarSide from "./components/navbar_side";
import data from './data.json';

function App() {
    return ( 
    <div className="App">
        <Navbar/>
        <NavbarSide/>
        <div className="index_place">
        <h2>Place List</h2>
        </div>
        <div className="inner">
            {
            data && data.map( data => {
                return (<div className="box" key={data.id}>
                    <img src = {data.profile_image_url} alt="" width="124px" height="128px"/>
                    <img src = {data.images} alt="" width="50px" height="50px"/>
                    <br></br>
                    {data.name}
                    {data.rating}


                </div>
                )
            })}
        </div>


    </div>

    );
}

export default App;
